import Document, {Head,Main,NextScript} from 'next/document';

class MyDocument extends Document {
    render(){
        return (
            <html>
                <Head>
                    <title>House</title>
                    <link rel="stylesheet" href="/.next/static/style.css"></link>
                </Head>
                <body>
                    <Main/>
                    <NextScript/>
                </body>
            </html>
        )
    }
}

export default MyDocument;
